function scrollNotZero(){return function(){const e="_not-top",o={wrapper:document.querySelector(".wrapper"),nav:document.querySelector(".nav"),menuLists:document.querySelectorAll(".nav__list"),logo:document.querySelector(".logo")};o.wrapper.addEventListener("scroll",()=>{0!=o.wrapper.scrollTop?(o.menuLists.forEach(o=>{o.classList.add(e)}),o.logo.classList.add(e),o.nav.classList.add(e)):(o.menuLists.forEach(o=>{o.classList.remove(e)}),o.logo.classList.remove(e),o.nav.classList.remove(e))},{passive:!0})}}scrollNotZero()();